detailed_description:
Основными направлениями научно-технической 
и производственной деятельности института являются:
Выполнение работ, определенных государственным оборонным заказом и  государственной программой вооружения;
Комплексные исследования по проблемам создания системы разведки и  предупреждения о воздушно-космическом нападении; 
Исследования по проблемам радиолокационного обнаружения, разработка и участие в серийном производстве РЛС для различных видов вооруженных  сил;
Исследования, включая экспериментальные работы в обеспечение создания  всех составных частей РЛС, в том числе унифицированных антенн, передатчиков и приёмников, устройств обработки сигналов и информации, а также устройств

АО ЛЗОС имеет все технологические переделы, обеспечивающие полный цикл изготовления оптических приборов. 
Основные направления деятельности АО ЛЗОС:
1.      Разработка и производство оптических материалов, включая варку стекла, изготовление оптических заготовок и   волоконно-оптических элементов;
2.      Обработка оптических материалов, разработка и производство крупногабаритной оптики, включая линзовые объективы, а также крупногабаритные зеркала космического и астрономического назначения;
3.      Разработка и производство оптико-механических и оптико-электронных приборов гражданского и специального назначения.

НАШИ ВОЗМОЖНОСТИ:
    - Институтом успешно внедряются передовые технологии и новаторские конструкторские решения, разрабатываются и осуществляются крупные инвестиционные проекты, осваиваются новые производственные мощности.
    - Приверженность профессиональным традициям, серьезный кадровый потенциал, основательная производственная, испытательная база позволяет нашему коллективу браться за серьезные задачи. 
      - Специалистами предприятия ведется работа по модернизации производства и внедрению современных технологий, отвечающих требованиям времени и мировым стандартам.

Институт обладает всеми необходимыми сертификатами и лицензиями на осуществление профессиональной деятельности.
    Наиболее востребованные профессии в организации:
инженер-схемотехник;
инженер-конструктор;
инженер-технолог по механической обработке 
изделий из металла и штамповой оснастки;
инженер-проектировщик АСУ ТП;
- инженер-программист промышленных контроллеров;
-        инженер-метролог.
Сегодня наиболее востребованы надпрофессиональные навыки: 
-  Инициативность;
-  Командная работа;
-  Критическое мышление;
  - Поиск и анализ информации; 
- Саморазвитие;
-  Способность быстро принимать решения.

Наша продукция

- взрыватели и капсюльные втулки для артиллерийских выстрелов;
- предохранительно-исполнительные механизмы, электронная аппаратура обработки информации для реактивных систем залпового огня;
- составные части управляемых ракетных;
- составные части боеприпасов;
- взрыватели и замедлители для турбореактивных снарядов и т.д.

Основные направления научной деятельности ИПУ РАН: 
теория систем и общая теория управления;
методы управления сложными техническими и человеко-машинными системами;
теория управления в междисциплинарных моделях организационных, социальных, экономических, медико-биологических и экологических систем;
научные основы технологий управления подвижными объектами и навигации;
теория и методы разработки программно-аппаратных и технических средств управления и сложных информационно-управляющих систем;
научные основы интегрированных систем управления и автоматизации технологических процессов и управление производством.
Полный жизненный цикл теории управления и ее приложений: фундаментальные исследования; образование; экспертиза; технологии/ПО – разработка, внедрение, сопровождение.

Институт входит в Холдинг «Швабе» Государственной корпорации «Ростех». 25 августа 2016 года распоряжением Правительства Москвы получил статус Технопарка.

 Институт специализируется в следующих основных направлениях квантовой электроники:
твердотельные лазеры и приборы на их основе;
полупроводниковые лазеры всех типов и приемо-передающие модули для волоконнооптических линий связи;
лазерные гироскопы на газовых лазерах и навигационные приборы;
активные, электрооптические и нелинейные кристаллы для лазеров;
квантоворазмерные структуры для полупроводниковых лазеров и фотоприемных устройств;
лазерные медицинские и технологические установки.

НИИ «Полюс» является поставщиком лазерных технологических установок, полупроводниковых и твердотельных лазеров, лазерных дальномеров и целеуказателей для высокоточного оружия, лазерных гироскопов различного типа и назначения, а также навигационных блоков на их основе.

На базе новейших научных достижений мы создаем совершенные технологии
и изобретения для государства и общества.

Основные направления деятельности:
 организация отбора и подготовки космонавтов (астронавтов), их медицинское освидетельствование, медицинское обеспечение и реабилитация после выполнения космических полетов;
 создание, размещение и модернизация наземных технических средств, применяемых для подготовки космонавтов (астронавтов);
 проведение научно-исследовательских и опытно-конструкторских работ по тематике пилотируемой космонавтики;
 обеспечение выполнения специальной летной подготовки космонавтов с использованием авиационной техники Центра;
 оказание услуг по направлениям, соответствующим профилю деятельности Центра, при реализации коммерческих проектов.

short_description:
АО «Долгопрудненское конструкторское бюро автоматики» - дочернее предприятие АО «Концерн радиостроения «Вега» и Холдинговой компании АО «ОПК», включено в Сводный реестр организаций оборонно-промышленного комплекса Российской Федерации
ДКБА ведет свою историю от созданного еще в 40-х годах прошлого века градообразующего предприятия «Дирижаблестрой СССР» и является единственным предприятием с государственным участием в России, где, начиная с 1956 г., и по настоящее время, проводятся работы по созданию всей номенклатуры воздухоплавательных комплексов - носителей целевой полезной нагрузки (включая РЭА):
автоматических дрейфующих аэростатов (АДА);
 привязных аэростатных комплексов;
 дирижаблей.

detailed_description:
Основными видами деятельности института являются:
-научно-техническое сопровождение проектирования и строительства кораблей и судов;
-проведение системных оценок этапов проектирования кораблей в части радиоэлектронного вооружения (РЭВ), научно-методическое и научно-техническое обеспечение разработок РЭВ;
-проведение комплексных исследований, разработка нормативно-методических документов и аппаратуры в обеспечение оптимизации совместного функционирования корабельных радиоэлектронных средств (РЭС) и их электромагнитной совместимости (ЭМС);
-проведение научных исследований по проблемам ЭМС РЭС совместно со специализированными учреждениями , судостроительной промышленности и других отраслей промышленности, участие в испытаниях образцов корабельного РЭВ на этапах их изготовления, а также систем вооружения кораблей в реальной помеховой обстановке;
-разработка программных комплексов автоматизации деятельности органов управления по контролю НИОКР;
-разработка стендов имитационного и полунатурного моделирования для обеспечения проектирования и испытаний корабельного вооружения, разработка тренажёрных комплексов и систем управления морскими судами;
-расчёт и разработка конструкций высокотехнологичного низкотемпературного холодильного оборудования для оборонно-промышленного комплекса, гражданского судостроения, медицины и других отраслей промышленности, основанного на применении запатентованных холодильных технологий двойного назначения: технологии низкотемпературного охлаждения и криостатирования с использованием смесевых парокомпрессионных холодильных машин, технологии охлаждения и термостатирования с использованием теплоносителя с фазовым переходом - «бинарного льда» и др.;
-расчёт, проектирование и подборка камбузного технологического и камбузного холодильного оборудования при разработке концептуальных проектов судов различного назначения.

На предприятии реализован полный цикл производства от научно-исследовательских работ до серийного изготовления изделия, его ввода в эксплуатацию, обслуживания и ремонта. 
Мы разработали БПЛА «Орлан-10», который принят на вооружение в Минобороны России.

Основные направления деятельности: 
Беспилотные летательные аппараты;
Спутниковые разработки;
Телекоммуникационное оборудование;
Информационная безопасность;
Информационные технологии и Искусственный 
интеллект;
Радиокомплексы и комплексы специального
     назначения.

Авиационная корпорация «Рубин» разрабатывает и производит комплектующие для всей авиационной техники российского производства, являясь единственным в своем роде предприятием на территории СНГ, тематикой которого являются:

взлетно-посадочные устройства
авиационные колеса из алюминиевых и титановых сплавов;
авиационные тормоза с применением углеродных, металлокерамических и биметаллических тормозных дисков;
агрегаты тормозных систем
гидравлические авиационные системы и агрегаты гидравлических систем
приводы-генераторы стабилизированной частоты;
гидравлические насосы и насосные станции;
гидравлические распределители с электромагнитным управлением, гидромоторы;
предохранительные, подпорные, термические клапаны;
редукторы гидравлические
По каждому направлению деятельности АК «Рубин» обеспечивает полный цикл возможностей, включая разработку, производство, ремонт и обслуживание изделий, научные исследования, испытания, анализ и моделирование.

Как непосредственный разработчик и производитель компонентов и расходных материалов для воздушных судов, АК «Рубин» также осуществляет ремонт и обслуживание агрегатов гидравлических систем, колес и тормозных устройств самолетов, произведенных в России и странах постсоветского пространства.

Сегодня Авиационной корпорацией  «Рубин» сделана ставка на создание конкурентоспособного производства, способного как к серийному выпуску, так и к созданию уникальных изделий, дающих российской авиации уверенно держать марку лидера в авиа-мире. Поэтому предприятие активно занимается вопросами инновации, технического переоснащения и модернизации производства.

Предприятие располагает самыми современными производственными станками с программным управлением, организованы поточные линии. Также АК "Рубин" обладает уникальным испытательным оборудованием для агрегатов и устройств собственного производства.

В своих разработках Авиационная корпорация «Рубин» использует новейшие технологии, что дает возможность уверенно выходить на новые рынки, находить новых партнеров и взаимовыгодные контракты.

Основные направления деятельности:
разработка прогноза и основных направлений развития авиационных двигателей с учётом достижений мировой авиационной науки и техники;
фундаментальные исследования в областях газовой динамики, прочности, теплообмена, горения, акустики;
прикладные исследования по формированию облика различных типов воздушно-реактивных, авиационных поршневых и ракетных двигателей; проектированию узлов и систем авиационных двигателей; обеспечению надёжности и безотказности;
испытания авиационных двигателей, их узлов и систем в реальных условиях эксплуатации;
проектирование стендового оборудования и средств измерений;
разработка высокоэффективных ГТУ для энергетики и газоперекачки.
